import React from 'react';
import './cart.css';
import cartimg from '../asset/cart/png';

const testProduct = [
    'chips',
    'laptop',
]
const Cart = ()=>(

    <div class="allcartdiv">
        <img src={cartimg} alt="cartIMG" />
        <div class="shopingcartlist" >
        <ul>
            {testProduct.map((product) => (
                <li>{product}</li>
            ))}
        </ul>
        </div>
    </div>
);
export default Cart
